import React from 'react';
import './LandingPage.css';
import Navbar from './Navbar';

const LandingPage = () => {
    return (
        <div>
           <Navbar />
           <div className='main-container'>
                <div class="hero-content">
            <h1>Indian Food is more than curry</h1>
            <p>Try your next new recipe</p>
            <button class="cta-btn">Get started</button>
        </div>
        <div class="image-grid">
            <img src="placeholder1.jpg" alt="Samosas on wooden board" />
            <img src="placeholder2.jpg" alt="Dosa with accompaniments" />
            <img src="placeholder3.jpg" alt="Indian appetizer" />
            <img src="placeholder4.jpg" alt="Orange appetizers with chutney" />
        </div>
           </div>
        </div>
    );
};

export default LandingPage;
